import React from 'react'
import { Document, Page } from 'react-pdf';
export const Resume = () => {
  const url = '././assets/Rushikesh-Amrut-Chape-FlowCV-Resume-20240306.pdf';
  return (
    <div>
    <Document file={url}>
    <Page pageNumber={1} />
    </Document>
    </div>
  )
}
